  render(){

    return(
      <div className="ui secondary pointing menu">
        <div className="right menu">
          currentUserId
          <GoogleAuth />
        </div>
      </div>
    );
  }
}

const mapStateToProps = state => {
  return{
    currentUserId: state.auth.userId
  }
}

export default connect(mapStateToProps, null)(Blog);
